    public void onErrorRecovery(List<Object> discardedSymbols)
    {
                    for (int i = 0; i < discardedSymbols.size(); i++)
                    {
                        if (discardedSymbols.get(i) instanceof HashMap)
                        {
                            HashMap map = (HashMap)discardedSymbols.get(i);
                            IASTListNode<IASTNode> errorRecoveryList = (IASTListNode<IASTNode>)map.get("errorRecoveryList");
                            discardedSymbols.set(i, errorRecoveryList);
                            for (IASTNode n : errorRecoveryList)
                                if (n != null)
                                    n.setParent(errorRecoveryList);
                        }
                    }
    }
